			dp[i] = Math.max(dp[i-1], a[i] + b[i] + c[i]);
			for(int j = 0; j < i; j++){
				dp[i] = Math.max(dp[i], dp[j] + a[i] + b[i] + c[i]);
			}
		}
		return dp[n-1];
	}
}
