	public static TreeNode increasingOrderSearchTree(TreeNode root){
		if(root == null) return null;
		TreeNode left = increasingOrderSearchTree(root.left);
		TreeNode right = increasingOrderSearchTree(root.right);
		if(left != null){
			if(left.val > root.val){
				TreeNode temp = left;
				left = root;
				root = temp;
			}
		}
		if(right != null){
			if(right.val > root.val){
				TreeNode temp = right;
				right = root;
				root = temp;
			}
		}
		root.left = left;
		root.right = right;
		return root;
	}
