	public int sumOfDeepestLeaves(TreeNode root, int[] depth, int max, int maxDepth) {
		if (root == null) {
			return 0;
		}
		if (root.left == null && root.right == null) {
			if (depth[0] > maxDepth) {
				maxDepth = depth[0];
				max = root.val;
			} else if (depth[0] == maxDepth) {
				max += root.val;
			}
			return root.val;
		}
		depth[0]++;
		int left = sumOfDeepestLeaves(root.left, depth, max, maxDepth);
		depth[0]--;
		int right = sumOfDeepestLeaves(root.right, depth, max, maxDepth);
		if (depth[0] > maxDepth) {
			maxDepth = depth[0];
			max = left + right;
		} else if (depth[0] == maxDepth) {
			max += left + right;
		}
		return left + right;
	}
}
