	static int[] monotonicArray(int[] array){
		int[] result = new int[array.length];
		int i = 0;
		int j = 0;
		int k = 0;
		while(i < array.length){
			if(array[i] < array[j]){
				result[k] = array[i];
				i++;
				k++;
			}
			else{
				result[k] = array[j];
				j++;
				k++;
			}
		}
		return result;
	}
}
	static boolean isMonotonic(int[] A){
