		if(A[i]<A[i+1]){
			for(int j=i+1;j<A.length;j++){
				if(A[j]<A[j-1]) return false;
			}
		}
		else{
			for(int j=i+1;j<A.length;j++){
				if(A[j]>A[j-1]) return false;
			}
		}
		return true;
	}
