		int[][] res = new int[m][n];
		for(int i = 0; i < m; i++){
			for(int j = 0; j < n; j++){
				if(matrix[i][j] == 0){
					res[i][j] = 0;
				}else{
					res[i][j] = Integer.MAX_VALUE;
				}
			}
		}
		for(int i = 0; i < m; i++){
			for(int j = 0; j < n; j++){
				if(i - 1 >= 0){
					res[i][j] = Math.min(res[i][j], res[i - 1][j] + 1);
				}
				if(j - 1 >= 0){
					res[i][j] = Math.min(res[i][j], res[i][j - 1] + 1);
				}
			}
