		for(int i = m - 1; i >= 0; i--){
			for(int j = n - 1; j >= 0; j--){
				if(i + 1 < m){
					res[i][j] = Math.min(res[i][j], res[i + 1][j] + 1);
				}
				if(j + 1 < n){
					res[i][j] = Math.min(res[i][j], res[i][j + 1] + 1);
				}
			}
		}
		return res;
	}
