				level.add(cur.val);
				for(Node child : cur.children){
					q.offer(child);
				}
			}
			res.add(level);
		}
		return res;
	}
}
	void levelOrder(Node root){
		if(root==null) return;
		Queue<Node> q=new LinkedList<Node>();
		q.add(root);
		while(!q.isEmpty()){
			Node cur=q.remove();
			System.out.print(cur.val+" ");
			for(Node n:cur.children){
				q.add(n);
			}
		}
	}
