	static String maxRepeatingSubstring(String str){
		int n = str.length();
		int maxLen = 0;
		int start = 0;
		int end = 0;
		int[] count = new int[n];
		for(int i = 0; i < n; i++){
			count[i] = 1;
			for(int j = 0; j < i; j++){
				if(str.charAt(i) == str.charAt(j)){
					count[i]++;
					if(count[i] > count[j]){
						count[j] = count[i];
						start = j;
						end = i;
					}
				}
			}
			if(count[i] > maxLen){
				maxLen = count[i];
				start = i;
				end = i;
			}
		}
		return str.substring(start, end+1);
	}
