	String maxRepeatingSubstring(String str){
		int n = str.length();
		int[] lps = new int[n];
		int i = 1, j = 0;
		int maxLen = 0;
		int start = 0;
		while(i < n){
			if(str.charAt(i) == str.charAt(j)){
				lps[i] = j + 1;
				i++;
				j++;
			}
			else if(j == 0){
				lps[i] = 0;
				i++;
			}
			else{
				j = lps[j - 1];
			}
		}
		i = 0;
		j = 0;
		while(i < n){
			if(str.charAt(i) == str.charAt(j)){
				i++;
				j++;
			}
			else if(j == 0){
				i++;
			}
			else{
				j = lps[j - 1];
			}
			if(maxLen < j - i + 1){
				maxLen = j - i + 1;
				start = i;
			}
		}
		return str.substring(start, start + maxLen);
	}
}

	int search(int[] A, int target) {
		int start = 0;
		int end = A.length - 1;
		while (start <= end) {
			int mid = (start + end) / 2;
			if (A[mid] == target) {
				return mid;
			}
			if (A[start] <= A[mid]) {
				if (A[start] <= target && target < A[mid]) {
					end = mid - 1;
				} else {
					start = mid + 1;
				}
			} else {
				if (A[mid] < target && target <= A[end]) {
					start = mid + 1;
				} else {
					end = mid - 1;
				}
			}
		}
		return -1;
	}
}
