	int jump(int[] A) {
		int n = A.length;
		int[] dp = new int[n];
		dp[0] = 0;
		for (int i = 1; i < n; i++) {
			int max = 0;
			for (int j = 0; j < i; j++) {
				if (j + A[j] >= i) {
					max = Math.max(max, dp[j] + 1);
				}
			}
			dp[i] = max;
		}
		return dp[n - 1];
	}
}
