		}
		int kk = k - i;
		int jj = j + 1;
		while (kk > 0 && jj < len) {
			if (nums[jj] < nums[jj - 1]) {
				jj++;
			} else {
				kk--;
				jj++;
			}
		}
		if (kk > 0) {
			return String.valueOf(nums, 0, i);
		}
		return String.valueOf(nums, 0, i) + String.valueOf(nums, jj, len - jj);
