	int maxNonOverlapping(int[] nums, int target) {
		int max = 0;
		int sum = 0;
		int start = 0;
		int end = 0;
		for (int i = 0; i < nums.length; i++) {
			sum += nums[i];
			while (sum > target) {
				sum -= nums[start];
				start++;
			}
			if (sum == target) {
				max = Math.max(max, i - start + 1);
			}
		}
		return max;
	}
}
