	int numSubarrayBoundedMax(int[] A, int L, int R) {
		int count = 0;
		int left = 0;
		int right = 0;
		int sum = 0;
		while (right < A.length) {
			if (A[right] <= R) {
				sum += A[right];
				right++;
			} else {
				count += (right - left);
				while (left < right && A[left] <= L) {
					sum -= A[left];
					left++;
				}
				count += (right - left);
			}
		}
		return count;
	}
}
