	public static int ksp(int[][] flights, int src, int dst, int k){
		int[][] dp = new int[flights.length][k + 1];
		for(int i = 0; i < flights.length; i++){
			dp[i][0] = flights[src][i];
		}
		for(int j = 1; j <= k; j++){
			for(int i = 0; i < flights.length; i++){
				for(int m = 0; m < flights.length; m++){
					dp[i][j] = Math.min(dp[i][j], dp[m][j - 1] + flights[m][i]);
				}
			}
		}
		return dp[dst][k];
	}
}
