	public static int countPaths(int[][] grid){
		int m = grid.length;
		int n = grid[0].length;
		int[][] dp = new int[m][n];
		dp[0][0] = 1;
		for(int i = 0; i < m; i++){
			for(int j = 0; j < n; j++){
				if(grid[i][j] == 0){
					dp[i][j] = 0;
				}
				else if(i == 0 && j == 0){
					dp[i][j] = 1;
				}
				else if(i == 0){
					dp[i][j] = dp[i][j-1];
				}
				else if(j == 0){
					dp[i][j] = dp[i-1][j];
				}
				else{
					dp[i][j] = dp[i-1][j] + dp[i][j-1];
				}
			}
		}
		return dp[m-1][n-1];
	}
}
