			for (int j = 1; j <= m; j++) {
				if (s.charAt(i - 1) == t.charAt(j - 1)) {
					dp[i][j] = dp[i - 1][j - 1] + 1;
				} else {
					dp[i][j] = Math.max(dp[i - 1][j], dp[i][j - 1]);
				}
			}
		}
		int res = 0;
		for (int i = 0; i <= n; i++) {
			for (int j = 0; j <= m; j++) {
				if (dp[i][j] <= maxCost) {
					res = Math.max(res, dp[i][j]);
				}
			}
		}
		return res;
	}
}
