	static int equalSubstring(String s, String t, int maxCost) {
		int len = s.length();
		int[] dp = new int[len];
		int max = 0;
		for(int i = 0; i < len; i++){
			dp[i] = Math.abs(s.charAt(i) - t.charAt(i));
			if(dp[i] > max) max = dp[i];
		}
		if(max <= maxCost) return len;
		int[] dp2 = new int[len];
		dp2[0] = dp[0];
		for(int i = 1; i < len; i++){
			dp2[i] = dp2[i - 1] + dp[i];
		}
		int[] dp3 = new int[len];
		dp3[len - 1] = dp[len - 1];
		for(int i = len - 2; i >= 0; i--){
			dp3[i] = dp3[i + 1] + dp[i];
		}
		int ans = 0;
		for(int i = 0; i < len; i++){
			int left = i;
			int right = i;
			int sum = dp[i];
			while(left >= 0 && right < len && sum <= maxCost){
				sum += dp[right];
				sum -= dp[left];
				ans = Math.max(ans, right - left + 1);
				left--;
				right++;
			}
		}
		return ans;
	}
