	int minSubstringLen(String s, int k) {
		int n = s.length();
		int ans = n;
		int[] cnt = new int[26];
		for (int i = 0; i < n; ++i) {
			for (int j = 0; j < 26; ++j)
				cnt[j] = 0;
			for (int j = i; j < n; ++j) {
				cnt[s.charAt(j) - 'a']++;
				if (j - i + 1 > k)
					cnt[s.charAt(i) - 'a']--;
				if (j - i + 1 == k) {
					int sum = 0;
					for (int jj = 0; jj < 26; ++jj)
						sum += cnt[jj] * cnt[jj];
					ans = Math.min(ans, sum);
				}
			}
		}
		return ans == n ? -1 : ans;
	}
}

