	boolean findTarget(TreeNode root, int k) {
		if(root == null) return false;
		Stack<TreeNode> stack = new Stack<TreeNode>();
		Set<Integer> set = new HashSet<Integer>();
		TreeNode p = root;
		while(p != null){
			stack.push(p);
			p = p.left;
		}
		while(!stack.isEmpty()){
			p = stack.pop();
			if(set.contains(k - p.val)) return true;
			set.add(p.val);
			p = p.right;
			while(p != null){
				stack.push(p);
				p = p.left;
			}
		}
		return false;
	}
}
