	int longestSubarray(int[] nums, int limit) {
		int n = nums.length;
		int[] sums = new int[n + 1];
		for (int i = 0; i < n; i++) {
			sums[i + 1] = sums[i] + nums[i];
		}
		int ans = 0;
		for (int i = 0; i < n; i++) {
			for (int j = i + 1; j <= n; j++) {
				int abs = Math.abs(sums[j] - sums[i]);
				if (abs <= limit) {
					ans = Math.max(ans, j - i);
				}
			}
		}
		return ans;
	}
}
	int longestSubarray(int[] nums, int limit) {
