	private boolean dfs(int[] nums, int target, int k, int index, int cur, int[] sums) {
		if (k == 1) {
			return true;
		}
		if (cur == target) {
			return dfs(nums, target, k - 1, 0, 0, sums);
		}
		for (int i = index; i < nums.length; i++) {
			if (cur + nums[i] > target) {
				break;
			}
			if (dfs(nums, target, k, i + 1, cur + nums[i], sums)) {
				sums[k - 1] = nums[i];
				return true;
			}
		}
		return false;
	}
}
