	private boolean dfs(int[] nums, int target, int k, int index, int sum, int[] subset) {
		if (index == nums.length) {
			return sum == target;
		}
		for (int i = 0; i < k; i++) {
			if (subset[i] + nums[index] > target) {
				continue;
			}
			subset[i] += nums[index];
			if (dfs(nums, target, k, index + 1, sum + nums[index], subset)) {
				return true;
			}
			subset[i] -= nums[index];
		}
		return false;
	}
}
