	static int splitArray(int[] nums, int m) {
		int n = nums.length;
		int[][] dp = new int[m + 1][n + 1];
		for (int i = 1; i <= m; i++) {
			dp[i][1] = nums[0];
		}
		for (int i = 2; i <= n; i++) {
			dp[1][i] = dp[1][i - 1] + nums[i - 1];
		}
		for (int i = 2; i <= m; i++) {
			for (int j = 2; j <= n; j++) {
				dp[i][j] = Integer.MAX_VALUE;
				for (int k = 1; k < j; k++) {
					dp[i][j] = Math.min(dp[i][j], Math.max(dp[i - 1][k], dp[i][j - k]) + nums[k - 1]);
				}
			}
		}
		return dp[m][n];
	}
}
