	int maxCoins(int[] A) {
		int n = A.length;
		int[][] dp = new int[n + 1][n + 1];
		for (int i = 0; i <= n; i++) {
			Arrays.fill(dp[i], -1);
		}
		return helper(A, 0, n - 1, dp);
	}
	public int helper(int[] A, int i, int j, int[][] dp) {
		if (i > j) {
			return 0;
		}
		if (dp[i][j] != -1) {
			return dp[i][j];
		}
		int res = 0;
		for (int k = i; k <= j; k++) {
			res = Math.max(res, A[k] + helper(A, i, k - 1, dp) + helper(A, k + 1, j, dp));
		}
		dp[i][j] = res;
		return res;
	}
}
