	static int onlineStockSpan(int[] prices) {
		int[] span = new int[prices.length];
		int max = 0;
		for (int i = 0; i < prices.length; i++) {
			int j = i - 1;
			while (j >= 0 && prices[j] <= prices[i]) {
				j--;
			}
			span[i] = i - j;
			if (span[i] > max) {
				max = span[i];
			}
		}
		return max;
	}
}
	static int onlineStockSpan(int[] prices) {
		int[] span = new int[prices.length];
		int max = 0;
		for (int i = 0; i < prices.length; i++) {
			int j = i - 1;
			while (j >= 0 && prices[j] >= prices[i]) {
				j--;
			}
			if (j == -1) {
				span[i] = i + 1;
			} else {
				span[i] = i - j;
			}
			max = Math.max(max, span[i]);
		}
		return max;
	}
}
	int[] stockSpan(int[] price){
		int[] result = new int[price.length];
		int[] stack = new int[price.length];
		int top = -1;
		for(int i = 0; i < price.length; i++){
			while(top >= 0 && price[i] >= price[stack[top]]){
				top--;
			}
			result[i] = (top == -1) ? i + 1 : i - stack[top];
			stack[++top] = i;
		}
		return result;
	}
}

