	static int rangeAdditionII(int[] A, int K){
		int n = A.length;
		int[] B = new int[n];
		for(int i = 0; i < n; i++){
			B[i] = A[i] % K;
		}
		int sum = 0;
		for(int i = 0; i < n; i++){
			sum += B[i];
		}
		int max = sum;
		for(int i = 0; i < n; i++){
			sum = sum - B[i] + K;
			max = Math.max(max, sum);
		}
		return max;
	}
}
