	static int rangeAdditionII(int[] A, int K){
		int n = A.length;
		int[] sum = new int[n];
		sum[0] = A[0];
		for(int i = 1; i < n; i++){
			sum[i] = sum[i-1] + A[i];
		}
		int max = 0;
		for(int i = 0; i < n; i++){
			for(int j = i; j < n; j++){
				int x = sum[j] - (i == 0 ? 0 : sum[i-1]);
				max = Math.max(max, x % K);
			}
		}
		return max;
	}
}
