	static int countSubsequences(int[] nums, int target) {
		int n = nums.length;
		int[][] dp = new int[n][target + 1];
		for (int i = 0; i < n; i++) {
			for (int j = 0; j <= target; j++) {
				if (j == 0) {
					dp[i][j] = 1;
				} else if (j >= nums[i]) {
					dp[i][j] = dp[i - 1][j] + dp[i - 1][j - nums[i]];
				} else {
					dp[i][j] = dp[i - 1][j];
				}
			}
		}
		return dp[n - 1][target];
	}
}
