			for (int j = 0; j < n; j++) {
				if (matrix[i][j] == 1) {
					if (i == 0 || j == 0) {
						dp[i][j] = 1;
					} else {
						dp[i][j] = dp[i - 1][j] + dp[i][j - 1] + 1;
					}
					count += dp[i][j];
				}
			}
		}
		return count;
	}
}
	int countSquares(int[][] matrix) {
		int m = matrix.length;
		int n = matrix[0].length;
		int[][] dp = new int[m][n];
		int count = 0;
		for (int i = 0; i < m; i++) {
			for (int j = 0; j < n; j++) {
				if (matrix[i][j] == 1) {
					dp[i][j] = (i > 0 && j > 0) ? dp[i - 1][j - 1] + 1 : 1;
					count += dp[i][j];
				}
			}
		}
		for (int i = 0; i < m; i++) {
			for (int j = 0; j < n; j++) {
				if (matrix[i][j] == 1) {
					if (i > 0) {
						dp[i][j] = Math.min(dp[i][j], dp[i - 1][j] + 1);
					}
					if (j > 0) {
						dp[i][j] = Math.min(dp[i][j], dp[i][j - 1] + 1);
					}
				}
			}
		}
		return count;
	}
}

