		if(n==2) return 1;
		return tribonacci(n-1)+tribonacci(n-2)+tribonacci(n-3);
	}
}
	static int tribonacci(int n) {
		if(n==0) return 0;
		if(n==1) return 1;
		if(n==2) return 1;
		int a=0,b=1,c=1;
		for(int i=3;i<=n;i++){
			int d=a+b+c;
			a=b;
			b=c;
			c=d;
		}
		return c;
	}
}
	static int tribonacci(int n){
		int[] tribonacci = new int[n+1];
		tribonacci[0] = 0;
		tribonacci[1] = 1;
		tribonacci[2] = 1;
		for(int i = 3; i <= n; i++){
			tribonacci[i] = tribonacci[i-1] + tribonacci[i-2] + tribonacci[i-3];
		}
		return tribonacci[n];
	}
}

