	static int minMagicBeans(int[] arr){
		int n = arr.length;
		int[] dp = new int[n];
		dp[0] = 1;
		dp[1] = 1;
		for(int i = 2; i < n; i++){
			dp[i] = dp[i-1] + dp[i-2];
		}
		int ans = dp[n-1];
		for(int i = 0; i < n; i++){
			ans = Math.min(ans, dp[i] + (n-i-1));
		}
		return ans;
	}
}
	static int minMagicBeans(int[] A, int[] B, int[] C){
		int n = A.length;
		int[] dp = new int[n];
		dp[0] = A[0] + B[0] + C[0];
		for(int i = 1; i < n; i++){
			dp[i] = Math.min(dp[i-1] + A[i] + B[i] + C[i], A[i] + B[i] + C[i]);
			dp[i] = Math.min(dp[i], A[i] + B[i] + C[i]);
			dp[i] = Math.min(dp[i], A[i] + B[i]);
			dp[i] = Math.min(dp[i], A[i]);
		}
		return dp[n-1];
	}
}
