		for(int i = 2; i < n; i++){
			dp[i] = Math.min(dp[i-1], dp[i-2]) + magicBeans[i];
		}
		return dp[n-1];
	}
}
	static int minMagicBeans(int[] A, int[] B){
		int n = A.length;
		int[] dp = new int[n];
		dp[0] = A[0] + B[0];
		for(int i = 1; i < n; i++){
			dp[i] = Math.min(dp[i-1] + A[i] + B[i], dp[i-1] + B[i]);
		}
		int min = dp[n-1];
		for(int i = 0; i < n; i++){
			min = Math.min(min, dp[i] + A[n-1] + B[n-1] - A[i] - B[i]);
		}
		return min;
	}
}

