	int countSubsets(int[] nums) {
		int n = nums.length;
		int[] dp = new int[n + 1];
		dp[0] = 1;
		dp[1] = 1;
		for (int i = 2; i <= n; i++) {
			dp[i] = dp[i - 1];
			for (int j = 0; j < i - 1; j++) {
				if (nums[j] <= nums[i - 1]) {
					dp[i] += dp[j];
				}
			}
		}
		return dp[n];
	}
}
