		for (int i = 1; i < n; i++) {
			dp[i] = dp[i - 1];
			for (int j = 0; j < i; j++) {
				if (A[i] > A[j] && A[i] < A[i - 1]) {
					dp[i] = Math.max(dp[i], dp[j] + 1);
				}
			}
		}
		int res = 0;
		for (int i = 0; i < n; i++) {
			res += dp[i];
		}
		return res;
	}
