		int[] res = new int[n];
		int i = 0;
		int j = n - 1;
		int count = 0;
		while(count < n){
			if(i == j){
				res[count] = i;
				count++;
				i++;
				j--;
			}
			else if(i < j){
				res[count] = i;
				count++;
				i++;
			}
			else{
				res[count] = j;
				count++;
				j--;
			}
		}
		return res;
	}
