	int minSum(int[] A, int K){
		int n = A.length;
		int[] dp = new int[n];
		dp[0] = A[0];
		for(int i = 1; i < n; i++){
			dp[i] = dp[i-1] + A[i];
		}
		int min = dp[n-1];
		for(int i = 0; i < n; i++){
			for(int j = i; j < n; j++){
				if(j - i + 1 >= K){
					min = Math.min(min, dp[j] - dp[i]);
				}
			}
		}
		return min;
	}
}

