	void nextGreaterElements(int[] nums) {
		int n = nums.length;
		int[] next = new int[n];
		int[] stack = new int[n];
		int top = -1;
		for (int i = 0; i < n; i++) {
			while (top >= 0 && nums[stack[top]] < nums[i]) {
				next[stack[top]] = nums[i];
				top--;
			}
			stack[++top] = i;
		}
		for (int i = 0; i < n; i++) {
