	public static int[] solve(String[] a, int[] b, int[] c){
		int[] result = new int[c.length];
		for(int i = 0; i < c.length; i++){
			int count = 0;
			for(int j = 0; j < a.length; j++){
				if(a[j].length() >= c[i]){
					if(a[j].substring(a[j].length() - c[i], a[j].length()).equals(b[i])){
						count++;
					}
				}
			}
			result[i] = count;
		}
		return result;
	}
