	int findLengthOfShortestSubarray(int[] arr) {
		int n = arr.length;
		int[] left = new int[n];
		int[] right = new int[n];
		int res = n;
		for (int i = 0; i < n; i++) {
			left[i] = i;
			while (left[i] > 0 && arr[i] <= arr[left[i] - 1]) {
				left[i] = left[left[i] - 1];
			}
		}
		for (int i = n - 1; i >= 0; i--) {
			right[i] = i;
			while (right[i] < n - 1 && arr[i] <= arr[right[i] + 1]) {
				right[i] = right[right[i] + 1];
			}
		}
		for (int i = 0; i < n; i++) {
			res = Math.min(res, i - left[i] + 1 + right[i] - i);
		}
		return res;
	}
}
