		int maxDegree = 0;
		for (int i = 0; i < n; i++) {
			degree[i] = 1;
			for (int j = i + 1; j < n; j++) {
				if (nums[i] == nums[j]) {
					degree[i]++;
				}
			}
			if (degree[i] > maxDegree) {
				maxDegree = degree[i];
			}
		}
		int ans = n;
		for (int i = 0; i < n; i++) {
			if (degree[i] == maxDegree) {
				int left = i;
				int right = i;
				while (left > 0 && nums[left - 1] == nums[i]) {
					left--;
				}
				while (right < n - 1 && nums[right + 1] == nums[i]) {
					right++;
				}
				ans = Math.min(ans, right - left + 1);
			}
		}
		return ans;
	}
}
