			return false;
		int i=0;
		while(i<arr.length-1 && arr[i]<=arr[i+1])
			i++;
		if(i==arr.length-1)
			return true;
		int j=i+1;
		while(j<arr.length && arr[j]>=arr[i])
			j++;
		if(j==arr.length)
			return true;
		return false;
	}
}

