	static double sqrt(double x){
		if(x<0)
			throw new IllegalArgumentException();
		double epsilon=1e-15;
		double t=x;
		while(Math.abs(t-x/t)>epsilon*t)
			t=(x/t+t)/2.0;
		return t;
	}
}
