		int sum = 0;
		int count = 0;
		Queue<TreeNode> q = new LinkedList<TreeNode>();
		q.offer(root);
		while(!q.isEmpty()){
			int size = q.size();
			for(int i = 0; i < size; i++){
				TreeNode node = q.poll();
				sum += node.val;
				if(node.left != null) q.offer(node.left);
				if(node.right != null) q.offer(node.right);
			}
			count++;
		}
		return sum/count;
	}
}
