		int[][] dp = new int[m][n];
		for (int i = 0; i < m; i++) {
			dp[i][0] = A[i][0];
		}
		for (int j = 1; j < n; j++) {
			for (int i = 0; i < m; i++) {
				dp[i][j] = A[i][j] + Math.min(dp[i - 1][j - 1], Math.min(dp[i - 1][j], dp[i][j - 1]));
			}
		}
		int res = dp[0][n - 1];
		for (int i = 1; i < m; i++) {
			res = Math.min(res, dp[i][n - 1]);
		}
		return res;
	}
}
