	int minFallingPathSum(int[][] A) {
		int m = A.length;
		int n = A[0].length;
		int[] dp = new int[n];
		for (int i = 0; i < m; i++) {
			int[] next = new int[n];
			for (int j = 0; j < n; j++) {
				int min = Integer.MAX_VALUE;
				for (int k = 0; k < n; k++) {
					if (j == k) continue;
					min = Math.min(min, dp[k]);
				}
				next[j] = Math.min(min, dp[j]) + A[i][j];
			}
			dp = next;
		}
		int res = Integer.MAX_VALUE;
		for (int i = 0; i < n; i++) {
			res = Math.min(res, dp[i]);
		}
		return res;
	}
}
