		int n = matrix[0].length;
		int[][] dp = new int[m][n];
		int res = 0;
		for (int i = 0; i < m; i++) {
			for (int j = 0; j < n; j++) {
				if (matrix[i][j] == 1) {
					dp[i][j] = 1;
					if (i > 0) {
						dp[i][j] += dp[i - 1][j];
					}
					if (j > 0) {
						dp[i][j] += dp[i][j - 1];
					}
					if (i > 0 && j > 0) {
						dp[i][j] -= dp[i - 1][j - 1];
					}
				}
			}
		}
		for (int i = 0; i < m; i++) {
			for (int j = 0; j < n; j++) {
				if (dp[i][j] >= k) {
					res++;
				}
			}
		}
		return res;
	}
