	public boolean isValid(String word, String[] chars){
		int[] charCount = new int[26];
		for(char c:word.toCharArray()){
			charCount[c-'a']++;
		}
		for(String c:chars){
			int[] temp = new int[26];
			for(char ch:c.toCharArray()){
				temp[ch-'a']++;
			}
			if(Arrays.equals(charCount,temp)){
				return true;
			}
		}
		return false;
	}
}

