	int findUnsortedSubarray(int[] nums) {
		int n = nums.length;
		int[] copy = new int[n];
		int left = 0, right = 0;
		int min = Integer.MAX_VALUE, max = Integer.MIN_VALUE;
		for (int i = 0; i < n; i++) {
			copy[i] = nums[i];
			min = Math.min(min, nums[i]);
			max = Math.max(max, nums[i]);
		}
		for (int i = 0; i < n; i++) {
			if (nums[i] != min)
				break;
			left = i;
		}
		for (int i = n - 1; i >= 0; i--) {
			if (nums[i] != max)
				break;
			right = i;
		}
		int count = 0;
		for (int i = 0; i < n; i++) {
			if (nums[i] != copy[i])
				count++;
		}
		return count == 0 ? 0 : right - left + 1;
	}
}
	static int findUnsortedSubarray(int[] nums) {
		int n = nums.length;
		int[] copy = new int[n];
		int left = 0, right = 0;
		for (int i = 0; i < n; i++) {
			copy[i] = nums[i];
		}
		Arrays.sort(copy);
		for (int i = 0; i < n; i++) {
			if (copy[i] != nums[i]) {
				left = i;
				break;
			}
		}
		for (int i = n - 1; i >= 0; i--) {
			if (copy[i] != nums[i]) {
				right = i;
				break;
			}
		}
		return right - left + 1;
	}
}

