		int max = Integer.MIN_VALUE;
		for(int i = 0; i < times.length; i++){
			min = Math.min(min, times[i]);
			max = Math.max(max, times[i]);
		}
		return max - min;
	}
}
	static int minTime(int[] time) {
		int min = Integer.MAX_VALUE;
		int max = Integer.MIN_VALUE;
		for(int i = 0; i < time.length; i++){
			if(time[i] < min){
				min = time[i];
			}
			if(time[i] > max){
				max = time[i];
			}
		}
		return max - min;
	}
}
