	static int minTime(int[] time) {
		int min = Integer.MAX_VALUE;
		for(int i = 0; i < time.length; i++){
			for(int j = i+1; j < time.length; j++){
				int diff = Math.abs(time[i] - time[j]);
				if(diff < min){
					min = diff;
				}
			}
		}
		return min;
	}
}
