	static int minTime(int[] arr, int m) {
		int n = arr.length;
		int[] count = new int[2400];
		for(int i = 0; i < n; i++)
			count[arr[i]]++;
		int ans = Integer.MAX_VALUE;
		int start = 0;
		for(int i = 0; i < 2400; i++) {
			while(count[i] > m) {
				count[start]--;
				start++;
			}
			if(i - start + 1 >= m)
				ans = Math.min(ans, i - start + 1);
		}
		return ans == Integer.MAX_VALUE ? -1 : ans;
	}
}
	static int minTime(int[] arr, int n)
	{
		int min = Integer.MAX_VALUE;
		int minIndex = 0;
		for(int i = 0; i < n; i++)
		{
			if(arr[i] < min)
			{
				min = arr[i];
				minIndex = i;
			}
		}
		int max = Integer.MIN_VALUE;
		int maxIndex = 0;
		for(int i = 0; i < n; i++)
		{
			if(arr[i] > max)
			{
				max = arr[i];
				maxIndex = i;
			}
		}
		if(minIndex > maxIndex)
		{
			return max - min;
		}
		else
		{
			return min - max;
		}
	}
